const SectionWrapper = ({ children, className }) => {
  return (
    <section
      className={`w-full mt-4 py-0 px-[10%] ${className}`}
      style={{ padding: "0 10%" }}
    >
      {children}
    </section>
  );
};

export { SectionWrapper };
